import { GET_PHOTOS } from "../types"

const initialState = {
    images:[{
        id: 1,
        title: "Isha",
        description: "programmer",
    }]
}

const imagesReducer = (state, action) => {
    switch(action.type) {
        case GET_PHOTOS:
            return state;
        default:
            return state;
    }
} 

export default imagesReducer;

